import { Link, useParams } from "react-router-dom";

function ProductsDetailPage(){

    const params = useParams();

    return(<>
    <h1>제품 상세 페이지</h1>
    <p>{params.productId}</p>
    <p><Link to="..">뒤로가기</Link></p>
    </>
)
}

export default ProductsDetailPage;
